import React from "react";
import hotel from "./hotel.webp";
import p1 from "./p1.webp";
import p2 from "./p2.webp";
import p3 from "./p3.webp";
import p4 from "./p4.webp";

const LandingPage = () => {
  return (
    <div className="landing-page">
      <div className="container-fluid">
        <div className="row">
          <img
            src={hotel}
            alt="hotel"
            style={{ width: "100%" }}
            className="landingPhoto"
          ></img>
        </div>
        <div class="spacing"></div>
        <div>
          <hr style={{ height: "5px", color: "royalblue" }} />
        </div>
        <div class="spacing"></div>
        <div className="row">
          <div className="col-3">
            <img
              src={p1}
              alt="hotel"
              style={{ width: "95%" }}
              className="grid"
            ></img>
          </div>
          <div className="col-3">
            <img
              src={p2}
              alt="hotel"
              style={{ width: "95%" }}
              className="grid"
            ></img>
          </div>
          <div className="col-3">
            <img
              src={p3}
              alt="hotel"
              style={{ width: "95%" }}
              className="grid"
            ></img>
          </div>
          <div className="col-3">
            <img
              src={p4}
              alt="hotel"
              style={{ width: "95%" }}
              className="grid"
            ></img>
          </div>
        </div>
        <div className="row">
          <div className="col-3">
            <img
              src={p1}
              alt="hotel"
              style={{ width: "95%" }}
              className="grid"
            ></img>
          </div>
          <div className="col-3">
            <img
              src={p2}
              alt="hotel"
              style={{ width: "95%" }}
              className="grid"
            ></img>
          </div>
          <div className="col-3">
            <img
              src={p3}
              alt="hotel"
              style={{ width: "95%" }}
              className="grid"
            ></img>
          </div>
          <div className="col-3">
            <img
              src={p4}
              alt="hotel"
              style={{ width: "95%" }}
              className="grid"
            ></img>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
